('07baf2a0-d16c-4c56-b895-c68f27dfff9b', 'Základní plavání Čapkárna 17,00', 'Plavecké kurzy jsou určené pro děti, které se již nebojí vody a chtějí se naučit plavat. V hodinách učíme techniky jednotlivých plaveckých způsobů, především s pomůckami. Spoustu plaveckých dovedností vyučujeme formou her a soutěží. Cílem tohoto kurzu je, aby  děti získaly jistotu při plavání v hluboké vodě. Nabízíme Vašim dětem účast na tréninku 1x - 2x týdně.\n\nVěk 4 - 12 let.', 2018, 2019, 0, 2900, '2019-01-07 10:56:03', 'p.formankova', 12, '4ec93cb3-808e-4ca7-89f3-75cb46889d51'),
('cd2101b9-e696-475c-92a0-29c307bd6716', 'Zdokonalovací plavání Čapkárna 17,00', 'Plavecké kurzy jsou určené pro děti, které se již nebojí vody a chtějí se naučit plavat všechny plavecké způsoby.  V hodinách učíme techniky jednotlivých plaveckých způsobů s pomůckami i bez nich. Cílem tohoto kurzu je, aby  děti získaly jistotu při plavání v hluboké vodě a uplavaly co nejvíce metrů. Nabízíme Vašim dětem účast na tréninku 1x - 2x týdně.\n\nVěk 6 - 12 let.', 2018, 2019, 0, 2900, '2019-01-07 10:58:17', 'p.formankova', 12, '4ec93cb3-808e-4ca7-89f3-75cb46889d51'),
