('b3d57356-e82c-4e36-b207-8289412a8da6', 'Kondiční plavání ', 'Ne všechny děti mají potřebu závodit, ale přesto rády plavou a mají ambice se v plavání zlepšovat, popř. se věnovat plavání jako doplňkovému sportu. V hodinách se věnujeme rozvíjení pohybových dovedností ve vodě a zdokonalování všech plaveckých způsobů. Pravidelným tréninkem zlepšujeme u dětí fyzickou kondici a vytrvalost. Po domluvě s trenéry je možné děti přihlásit na závody. Nabízíme Vašim dětem účast na tréninku 1x - 2x týdně.\n\nVěk 13 - 20 let.\n\nCena: 1x týdně 2300,-Kč, 2x týdně 2900,- Kč/ pololetí', 2018, 2019, 0, 2900, '2019-01-07 10:33:56', 'p.formankova', 30, 'bc577f2f-b930-4164-ac73-1907c5393c67'),
