('a3f86254-1662-4a11-a42d-ee690f399c96', 'Závodní plavání ', 'Do této skupiny jsou zařazovány děti, které mají zájem o pravidelný trénink a účast na plaveckých závodech. Pravidelným tréninkem se z dětí stávají nejen fyzicky zdatní jedinci, ale také sportovci, osobnosti, které využívají vlastnosti získané při pravidelném trénování, tj. disciplína, sebekázeň, sebekritika, kolektivní myšlení, svědomitost, vytrvalost, rozvážnost, zásadovost, aj. nejen při sportu, ale i v životě. \n\nDěti mají trénink 5 x týdně.\n\nPlaveme jen v Porubě a to od pondělí do pátku.\n\nVěk 8 - 13 let.', 2018, 2019, 0, 3000, '2019-02-11 17:41:46', 'p.formankova', 20, 'bc577f2f-b930-4164-ac73-1907c5393c67'),
