('9e910801-2cb1-400f-acf6-db4488882e00', 'Neplavci Poruba 18,00', 'První plavecké krůčky všech dětí začínají většinou v prostoru dětského bazénu. Cílem výuky je rozvíjet kladný vztah k vodě, snažíme se, aby se děti vždy na plavání těšily, proto je hodina vedená herním systémem, který děti baví. Naučíme děti dýchat do vody, potápět se, splývat a skákat. Využíváme plavecké pomůcky, kde klademe důraz na pestrost a zábavu. K dětem přistupujeme dle schopností každého jednotlivého dítěte.\n\nVěk 4 - 6 let, výuka probíhá v malém bazénku. Vždy je cvičitel s dětmi ve vodě.\n\nCena: 2900,- Kč/ pololetí\n\nPlaveme jen v Porubě úterý a čtvrtek 18,00 hodin.', 2018, 2019, 0, 2900, '2019-01-07 11:12:23', 'p.formankova', 15, 'bc577f2f-b930-4164-ac73-1907c5393c67'),
